import React, { useState, useEffect } from 'react'
import { getMovieList } from '../api'

function Home() {
    const [movieList, setMovieList] = useState([])

    useEffect(() => {
        const fetch = async () => {
            const result = await getMovieList();
            console.log(result);
            setMovieList(result)
        }
        fetch();
    }, [])

    return (
        <div>
            하이
        </div>
    )
}

export default Home;
